import React from 'react';
import styled from 'styled-components';
import Button from '../../lib/Button';
import { useNavigate } from 'react-router-dom';

const Div = styled.div`
  width: 33%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: space-evenly;
`;

const SelectLeft = () => {
  const nav = useNavigate();

  const goNowPlayings = () => {
    nav('/nowplayings');
  };

  const goUpComings = () => {
    nav('/upcomings');
  };

  const goOtts = () => {
    nav('/otts');
  };
  return (
    <Div>
      <button onClick={goNowPlayings}><span>최신상영작</span></button>
      <button onClick={goUpComings}><span>개봉예정작</span></button>
      <button onClick={goOtts}></button>
    </Div>
  );
};

export default SelectLeft;
